a nori. NIGIRI SALMÓN; arroz cocido* y salmón (Salmo salar) (pescado). FUTOMAKI DE SALMÓN FLAMBEADO, AGUACATE, MANGO, QUESO Y MARACUYA: arroz cocido*, salmón (Salmo salar) (pescado). mango, aguacate, queso crema [leche pasteurizada de vaca, nata (leche) pasteurizada de vaca, sal, estabilizantes E-410, E-401 y E-407, conservador E-202 y fermentos lácticos (leche)], salsa maracuyá [puré de maracuyá (maracuyá, azúcar de caña), azúcar moreno, estabilizante E-415 y conservador E-202] y alga nori. *arroz, mezcla de vinagres (azúcar, vinagre de alcohol, agua, vinagre de arroz, sal, azúcar demerara) y aceite de maíz. Puede contener trazas de gluten, crustáceos, huevo, cacahuete, soia, apio, mcstaza, sulfitos, moluscos y frutos de cáscara. SALSA DE SOJA: salsa de soia [agua, soja, trigo, sal, potenciadores del sabor (E-621 y E-635), alcohol y edulcorantes (E-960a (dextrina) y E-954)]. Puede contener trazas de huevo, mostaza, sésamo y sulfitos. SALSA PONZU: salsa de soia [agua, soia, trigo, sal, potenciadores del sabor (E-621 y E-635), alcohol y edulcorantes (E-960a (dextrina) y E-954)]. mezcla de vinagres [azúcar, vinagre de alcohol, agua, vinagre de arroz, sal y azúcar demerara], zumo de limón [zumo de limón pasteurizado y antioxidante E-224 (sulfitos)] y zumo de mandarina. Puede contener trazas de huevo, mostaza y sésamo. WASABI: rábano picante en polvo, humectante E-420, agua, aceite de soja, sal, mostaza en polvo, maltodextrina, almidón modificado de maíz, aceite de mostaza, acidulante E-330, wasabi, espesante E-415, cúrcuma, colorante E-133.', 'Apio, Pescado, Gluten, Leche, Moluscos, Mostaza, Soja, Dióxido de azufre y sulfitos', ARRAY['en:celery','en:fish','en:gluten','en:milk','en:molluscs','en:mustard','en:soybeans','en:sulphur-dioxide-and-sulphites'], 'Apio, Crustáceos, Huevos, Gluten, Moluscos, Mostaza, Frutos de cáscara, Cacahuetes, Granos de sésamo, Soja, Dióxido de azufre y sulfitos', ARRAY['en:celery','en:crustaceans','en:eggs','en:gluten','en:molluscs','en:must